import React from "react";
import SData from "./SData";
import Cards from "./Cards";


const Netflix=()=>{
    return ( 
        <>
        <Cards
          key={SData[0].id}
          imgsrc={SData[0].imgsrc}
          title={SData[0].title}
          sname={SData[0].sname}
          links={SData[0].links}
        />
        <Cards
          key={SData[1].id}
          imgsrc={SData[1].imgsrc}
          title={SData[1].title}
          sname={SData[1].sname}
          links={SData[1].links}
        />
        <Cards
          key={SData[2].id}
          imgsrc={SData[2].imgsrc}
          title={SData[2].title}
          sname={SData[2].sname}
          links={SData[2].links}
        />
        <Cards
          key={SData[0].id}
          imgsrc={SData[3].imgsrc}
          title={SData[3].title}
          sname={SData[3].sname}
          links={SData[3].links}
        />
        <Cards
          key={SData[4].id}
          imgsrc={SData[4].imgsrc}
          title={SData[4].title}
          sname={SData[4].sname}
          links={SData[4].links}
        />
        </>
        );
}

export default Netflix;
